import React from 'react';

function Login() {
	return (
		<div>
			<header>
				<nav className='w-full navbar bg-base-300 justify-center'>
					<h1 className='text-xl font-bold'>Music Studio</h1>
				</nav>
			</header>
			<h1>Login</h1>
			<div key={i}>
				<input
					type='radio'
					id={mode}
					name='gameMode'
					value={mode}
					checked={gameData.gameconfig.gameMode === { mode }}
					onChange={handleConfigChange}
					className='hidden'
				/>
				<label
					htmlFor={mode}
					className={
						gameData.gameconfig.gameMode === mode
							? 'custom-bg-gray w-fit rounded-lg px-5 text-2xl text-white hover:cursor-pointer'
							: 'w-fit rounded-lg px-5 text-2xl hover:cursor-pointer'
					}
				>
					{mode === 'captureTheFlag' ? 'capture the flag' : mode}
				</label>
			</div>
		</div>
	);
}

export default Login;
